import React, { useState } from 'react';
import './MyProgress.css';

const MyProgress = () => {
  const [name, setName] = useState('');
  const [story, setStory] = useState('');
  const [beforeImage, setBeforeImage] = useState(null);
  const [afterImage, setAfterImage] = useState(null);
  const [draggingBefore, setDraggingBefore] = useState(false);
  const [draggingAfter, setDraggingAfter] = useState(false);

  const handleImageUpload = (event, type) => {
    const file = event.target.files[0];
    if (type === 'before') {
      setBeforeImage(file);
    } else {
      setAfterImage(file);
    }
  };

  const handleDrop = (event, type) => {
    event.preventDefault();
    const file = event.dataTransfer.files[0];
    if (type === 'before') {
      setBeforeImage(file);
    } else {
      setAfterImage(file);
    }
    setDraggingBefore(false);
    setDraggingAfter(false);
  };

  const handleDragOver = (event) => {
    event.preventDefault();
  };

  const handleDragEnter = (type) => {
    if (type === 'before') {
      setDraggingBefore(true);
    } else {
      setDraggingAfter(true);
    }
  };

  const handleDragLeave = (type) => {
    if (type === 'before') {
      setDraggingBefore(false);
    } else {
      setDraggingAfter(false);
    }
  };

  const handleSubmit = () => {
    const progressData = {
      name,
      story,
      beforeImage,
      afterImage,
    };

    console.log('Progress submitted:', progressData);
    alert('Your progress story has been posted to the Stories section!');
    resetFields();
  };

  const resetFields = () => {
    setName('');
    setStory('');
    setBeforeImage(null);
    setAfterImage(null);
  };

  return (
    <div className="progress-container">
      <form className="progress-form">
        <div className="name-section">
          <h3>Name</h3> {/* Sub-heading for Name section */}
          <input
            type="text"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Enter your name"
          />
        </div>

        <div className="story-section">
          <h3>Your Progress Story</h3> {/* Sub-heading for Story section */}
          <textarea
            id="story"
            value={story}
            onChange={(e) => setStory(e.target.value)}
            placeholder="Describe your progress"
          />
        </div>

        <div className="image-upload-container">
          <div
            className={`image-upload ${draggingBefore ? 'dragging' : ''}`}
            onDragOver={handleDragOver}
            onDragEnter={() => handleDragEnter('before')}
            onDragLeave={() => handleDragLeave('before')}
            onDrop={(e) => handleDrop(e, 'before')}
          >
            <label htmlFor="beforeImage">Before Image</label>
            <input
              type="file"
              id="beforeImage"
              onChange={(e) => handleImageUpload(e, 'before')}
            />
            {beforeImage ? <p>{beforeImage.name}</p> : <p>Drag and drop your before image</p>}
          </div>

          <div
            className={`image-upload ${draggingAfter ? 'dragging' : ''}`}
            onDragOver={handleDragOver}
            onDragEnter={() => handleDragEnter('after')}
            onDragLeave={() => handleDragLeave('after')}
            onDrop={(e) => handleDrop(e, 'after')}
          >
            <label htmlFor="afterImage">After Image</label>
            <input
              type="file"
              id="afterImage"
              onChange={(e) => handleImageUpload(e, 'after')}
            />
            {afterImage ? <p>{afterImage.name}</p> : <p>Drag and drop your after image</p>}
          </div>
        </div>

        <div className="buttons">
          <button type="button" className="submit-btn" onClick={handleSubmit}>
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default MyProgress;
